(1, 'แมว', 'ผู้', 0.00, 4.00, 0, 1, 'คุณสมบัติที่ควรมองหา: เสริมโปรตีนและแร่ธาตุ ลดโซเดียมเพื่อป้องกันโรคนิ่ว', 'Royal Canin Fit 32\nสูตรโปรตีนสมดุล\nราคา: 400-500 บาท (2 กก.)\nหาซื้อได้: Shopee, Lazada\n\nPurina One Cat Urinary Care\nลดความเสี่ยงโรคนิ่วในระบบทางเดินปัสสาวะ\nราคา: 400-600 บาท (1.3 กก.)\nหาซื้อได้: Big C, Lotus’s', 'ลูกแมวหลังหย่านมมักย่อยแลคโตสในนมวัวไม่ได้ ซึ่งอาจทำให้ท้องเสีย หากต้องการให้นม ควรใช้นมสำหรับลูกแมว โดยเฉพาะอาหารที่มีส่วนผสมของข้าวโพดหรือแป้งมากเกินไป อาจส่งผลให้ลูกแมวได้รับพลังงานจากคาร์โบไฮเดรตแทนที่จะเป็นโปรตีน'),
(2, 'แมว', 'เมีย', 0.00, 4.00, 0, 1, 'คุณสมบัติที่ควรมองหา: สูตรพลังงานต่ำ ลดความเสี่ยงอ้วน มีโอเมก้า-3 บำรุงขน', 'Hill’s Science Diet Light Adult Cat\nควบคุมน้ำหนักหลังทำหมัน\nราคา: 800-1,000 บาท (2 กก.)\nหาซื้อได้: Shopee, ร้านสัตวแพทย์\n\nWhiskas Wet Food Pouch\nอาหารเปียกช่วยให้ขนเงางาม\nราคา: 15-20 บาท/ซอง\nหาซื้อได้: 7-Eleven, Big C', 'ลูกแมวหลังหย่านมมักย่อยแลคโตสในนมวัวไม่ได้ ซึ่งอาจทำให้ท้องเสีย หากต้องการให้นม ควรใช้นมสำหรับลูกแมว โดยเฉพาะอาหารที่มีส่วนผสมของข้าวโพดหรือแป้งมากเกินไป อาจส่งผลให้ลูกแมวได้รับพลังงานจากคาร์โบไฮเดรตแทนที่จะเป็นโปรตีน'),
(3, 'แมว', 'ผู้', 4.00, 6.00, 0, 1, 'คุณสมบัติที่ควรมองหา: โปรตีนสูงเพื่อเสริมกล้ามเนื้อ ไฟเบอร์ช่วยควบคุมก้อนขน', 'Royal Canin Hairball Care\nลดก้อนขนในทางเดินอาหาร\nราคา: 1,200-1,400 บาท (4 กก.)\nหาซื้อได้: Shopee, Pet Shop\n\nMe-O Adult Cat Food\nมีทอรีนและวิตามินครบถ้วน\nราคา: 100-200 บาท (1.2 กก.)\nหาซื้อได้: Big C, Lotus’s', 'ลูกแมวหลังหย่านมมักย่อยแลคโตสในนมวัวไม่ได้ ซึ่งอาจทำให้ท้องเสีย หากต้องการให้นม ควรใช้นมสำหรับลูกแมว โดยเฉพาะอาหารที่มีส่วนผสมของข้าวโพดหรือแป้งมากเกินไป อาจส่งผลให้ลูกแมวได้รับพลังงานจากคาร์โบไฮเดรตแทนที่จะเป็นโปรตีน'),
(4, 'แมว', 'เมีย', 4.00, 6.00, 0, 1, 'คุณสมบัติที่ควรมองหา: อาหารไขมันต่ำสำหรับตัวที่ทำหมัน แคลเซียมเสริมความแข็งแรงของกระดูก', 'Royal Canin Sterilised Cat Food\nลดไขมันสะสมหลังทำหมัน\nราคา: 1,000-1,200 บาท (4 กก.)\nหาซื้อได้: Shopee, Lazada\n\nSmartHeart Gold Indoor Cat\nสำหรับแมวเลี้ยงในบ้าน ลดกลิ่นมูล\nราคา: 800-1,000 บาท (3 กก.)\nหาซื้อได้: Big C, Lotus’s', 'ลูกแมวหลังหย่านมมักย่อยแลคโตสในนมวัวไม่ได้ ซึ่งอาจทำให้ท้องเสีย หากต้องการให้นม ควรใช้นมสำหรับลูกแมว โดยเฉพาะอาหารที่มีส่วนผสมของข้าวโพดหรือแป้งมากเกินไป อาจส่งผลให้ลูกแมวได้รับพลังงานจากคาร์โบไฮเดรตแทนที่จะเป็นโปรตีน'),
(5, 'แมว', 'ผู้', 6.00, 999.00, 0, 1, 'คุณสมบัติที่ควรมองหา: สูตรควบคุมน้ำหนัก ลดความเสี่ยงข้ออักเสบ อาหารบำรุงไตสำหรับแมวอายุมาก', 'Hill’s Prescription Diet Metabolic + Urinary\nสำหรับแมวที่มีน้ำหนักเกินและปัญหาปัสสาวะ\nราคา: 1,500-1,800 บาท (4 กก.)\nหาซื้อได้: ร้านสัตวแพทย์\n\nRoyal Canin Weight Care\nช่วยควบคุมน้ำหนัก ลดความเสี่ยงไขมันเกิน\nราคา: 1,200-1,500 บาท (4 กก.)\nหาซื้อได้: Shopee, Lazada', 'ลูกแมวหลังหย่านมมักย่อยแลคโตสในนมวัวไม่ได้ ซึ่งอาจทำให้ท้องเสีย หากต้องการให้นม ควรใช้นมสำหรับลูกแมว โดยเฉพาะอาหารที่มีส่วนผสมของข้าวโพดหรือแป้งมากเกินไป อาจส่งผลให้ลูกแมวได้รับพลังงานจากคาร์โบไฮเดรตแทนที่จะเป็นโปรตีน'),
(6, 'แมว', 'ผู้', 0.00, 4.00, 1, 6, 'คุณสมบัติที่ควรมองหา: โปรตีนสูง ลดไขมัน ลดความเสี่ยงโรคนิ่ว', 'Royal Canin Fit 32\nราคา: 400-500 บาท (2 กก.)\nหาซื้อได้: Shopee, Lazada\n\nPurina One Urinary Care\nราคา: 400-600 บาท (1.3 กก.)\nหาซื้อได้: Big C, Lotus’s', '- อาหารปรุงรสจัด เช่น เค็ม หวาน หรือมีเครื่องเทศ (กระเทียม หัวหอม) อาจเป็นพิษต่อแมวและส่งผลเสียต่อระบบย่อยอาหาร\n\n- อาหารมันเยิ้ม เช่น เศษไก่ทอด เบคอน อาจเพิ่มความเสี่ยงต่อโรคตับและตับอ่อนอักเสบ\n\n- อาหารที่มีพลังงานและไขมันสูงเกินไปสำหรับแมวโต อาจทำให้น้ำหนักเกินหรือเกิดปัญหาสุขภาพ เช่น โรคเบาหวานและโรคหัวใจ\n\n- กระดูกไก่ กระดูกปลา อาจติดในคอหรือลำไส้ และทำให้บาดเจ็บ\n\n- อาจมีเชื้อแบคทีเรีย (เช่น ซัลโมเนลลา) หรือพยาธิที่เป็นอันตราย และปลาดิบบางชนิดยังมีสารยับยั้งการดูดซึมวิตามิน B1\n\n- อาหารจำพวกปลาดิบ (ของดิบ) อาจมีเชื้อแบคทีเรีย (เช่น ซัลโมเนลลา) หรือพยาธิที่เป็นอันตราย และปลาดิบบางชนิดยังมีสารยับยั้งการดูดซึมวิตามิน B1\n\n- ช็อกโกแลต คาเฟอีน หรือแอลกอฮอล์ เป็นพิษต่อแมวอย่างร้ายแรง อาจทำให้หัวใจเต้นผิดจังหวะ อาเจียน หรือในกรณีรุนแรง อาจถึงแก่ชีวิต'),
(7, 'แมว', 'เมีย', 0.00, 4.00, 1, 6, 'คุณสมบัติที่ควรมองหา: อาหารไขมันต่ำ ลดความเสี่ยงอ้วน เสริมโอเมก้า-3 และแร่ธาตุ', 'Hill’s Science Diet Light Adult Cat\nราคา: 800-1,000 บาท (2 กก.)\nหาซื้อได้: Shopee, ร้านสัตวแพทย์\n\nMe-O Gold Adult Cat Food\nราคา: 150-200 บาท (450 กรัม)\nหาซื้อได้: Big C, Lotus’s', '- อาหารปรุงรสจัด เช่น เค็ม หวาน หรือมีเครื่องเทศ (กระเทียม หัวหอม) อาจเป็นพิษต่อแมวและส่งผลเสียต่อระบบย่อยอาหาร\n\n- อาหารมันเยิ้ม เช่น เศษไก่ทอด เบคอน อาจเพิ่มความเสี่ยงต่อโรคตับและตับอ่อนอักเสบ\n\n- อาหารที่มีพลังงานและไขมันสูงเกินไปสำหรับแมวโต อาจทำให้น้ำหนักเกินหรือเกิดปัญหาสุขภาพ เช่น โรคเบาหวานและโรคหัวใจ\n\n- กระดูกไก่ กระดูกปลา อาจติดในคอหรือลำไส้ และทำให้บาดเจ็บ\n\n- อาจมีเชื้อแบคทีเรีย (เช่น ซัลโมเนลลา) หรือพยาธิที่เป็นอันตราย และปลาดิบบางชนิดยังมีสารยับยั้งการดูดซึมวิตามิน B1\n\n- อาหารจำพวกปลาดิบ (ของดิบ) อาจมีเชื้อแบคทีเรีย (เช่น ซัลโมเนลลา) หรือพยาธิที่เป็นอันตราย และปลาดิบบางชนิดยังมีสารยับยั้งการดูดซึมวิตามิน B1\n\n- ช็อกโกแลต คาเฟอีน หรือแอลกอฮอล์ เป็นพิษต่อแมวอย่างร้ายแรง อาจทำให้หัวใจเต้นผิดจังหวะ อาเจียน หรือในกรณีรุนแรง อาจถึงแก่ชีวิต'),
(8, 'แมว', 'เมีย', 6.00, 999.00, 0, 1, 'คุณสมบัติที่ควรมองหา: สูตรควบคุมน้ำหนัก ลดความเสี่ยงข้ออักเสบ อาหารบำรุงไตสำหรับแมวอายุมาก', 'Hill’s Prescription Diet Metabolic + Urinary\nสำหรับแมวที่มีน้ำหนักเกินและปัญหาปัสสาวะ\nราคา: 1,500-1,800 บาท (4 กก.)\nหาซื้อได้: ร้านสัตวแพทย์\n\nRoyal Canin Weight Care\nช่วยควบคุมน้ำหนัก ลดความเสี่ยงไขมันเกิน\nราคา: 1,200-1,500 บาท (4 กก.)\nหาซื้อได้: Shopee, Lazada', 'ลูกแมวหลังหย่านมมักย่อยแลคโตสในนมวัวไม่ได้ ซึ่งอาจทำให้ท้องเสีย หากต้องการให้นม ควรใช้นมสำหรับลูกแมว โดยเฉพาะอาหารที่มีส่วนผสมของข้าวโพดหรือแป้งมากเกินไป อาจส่งผลให้ลูกแมวได้รับพลังงานจากคาร์โบไฮเดรตแทนที่จะเป็นโปรตีน'),
