(12, 'แมว', 'เมีย', 6.00, 999.00, 1, 6, 'คุณสมบัติที่ควรมองหา: ลดไขมันสะสมและเสริมแคลเซียม มีวิตามินเพื่อสุขภาพขน', 'Hill’s Science Diet Adult Light\nราคา: 1,200-1,500 บาท (2 กก.)\nหาซื้อได้: Shopee, ร้านสัตวแพทย์\n\nRoyal Canin Sterilised 7+\nราคา: 1,000-1,500 บาท (2 กก.)\nหาซื้อได้: Shopee, Lazada', '- อาหารปรุงรสจัด เช่น เค็ม หวาน หรือมีเครื่องเทศ (กระเทียม หัวหอม) อาจเป็นพิษต่อแมวและส่งผลเสียต่อระบบย่อยอาหาร\n\n- อาหารมันเยิ้ม เช่น เศษไก่ทอด เบคอน อาจเพิ่มความเสี่ยงต่อโรคตับและตับอ่อนอักเสบ\n\n- อาหารที่มีพลังงานและไขมันสูงเกินไปสำหรับแมวโต อาจทำให้น้ำหนักเกินหรือเกิดปัญหาสุขภาพ เช่น โรคเบาหวานและโรคหัวใจ\n\n- กระดูกไก่ กระดูกปลา อาจติดในคอหรือลำไส้ และทำให้บาดเจ็บ\n\n- อาจมีเชื้อแบคทีเรีย (เช่น ซัลโมเนลลา) หรือพยาธิที่เป็นอันตราย และปลาดิบบางชนิดยังมีสารยับยั้งการดูดซึมวิตามิน B1\n\n- อาหารจำพวกปลาดิบ (ของดิบ) อาจมีเชื้อแบคทีเรีย (เช่น ซัลโมเนลลา) หรือพยาธิที่เป็นอันตราย และปลาดิบบางชนิดยังมีสารยับยั้งการดูดซึมวิตามิน B1\n\n- ช็อกโกแลต คาเฟอีน หรือแอลกอฮอล์ เป็นพิษต่อแมวอย่างร้ายแรง อาจทำให้หัวใจเต้นผิดจังหวะ อาเจียน หรือในกรณีรุนแรง อาจถึงแก่ชีวิต'),
(13, 'แมว', 'ผู้', 0.00, 4.00, 6, 999, 'คุณสมบัติที่ควรมองหา: ลดโปรตีนที่ไตต้องทำงานหนัก บำรุงข้อต่อและฟัน', 'Royal Canin Ageing 12+\nราคา: 1,500-2,000 บาท (4 กก.)\nหาซื้อได้: Shopee, Lazada\n\nHill’s Prescription Diet k/d Kidney Care\nราคา: 1,800-2,200 บาท (2 กก.)\nหาซื้อได้: ร้านสัตวแพทย์', '- การเผาผลาญพลังงานในแมวแก่ลดลง อาหารที่มีแคลอรีสูงไม่เหมาะกับแมวสูงวัยอย่างยิ่งมันอาจนำไปสู่โรคอ้วนและโรคเกี่ยวกับข้อต่อ\n\n- อาหารที่มีเกลือหรือโซเดียมสูง เช่น ขนมแมวปรุงรส หรืออาหารคน (ปลาเค็ม, ไส้กรอก) จะเพิ่มความเสี่ยงต่อโรคไตและโรคหัวใจ ซึ่งพบได้บ่อยในแมวสูงวัย\n\n- กระดูกและอาหารแข็งเกินไป แมวแก่ฟันอาจเริ่มสึกหรือหลุด อาหารที่แข็งเกินไปหรือกระดูกสัตว์ อาจทำให้ฟันหักหรือเจ็บเหงือก\n\n- อาหารที่มีโปรตีนต่ำเกินไป แม้ว่าการลดโปรตีนในแมวที่เป็นโรคไตจะเป็นสิ่งสำคัญ แต่แมวแก่ที่ยังมีสุขภาพดีจำเป็นต้องได้รับโปรตีนที่เพียงพอเพื่อรักษามวลกล้ามเนื้อ การให้อาหารที่มีโปรตีนน้อยเกินไปอาจทำให้แมวอ่อนแอ\n\n- ขนมหรืออาหารที่หวาน แมวไม่สามารถย่อยน้ำตาลได้ดี น้ำตาลจากขนม อาหารมนุษย์ หรือผลไม้บางชนิด อาจเพิ่มความเสี่ยงต่อโรคเบาหวานและน้ำหนักเกิน\n\n- อาหารดิบหรือไม่สุก แมวแก่มีระบบภูมิคุ้มกันที่อ่อนแอลง ทำให้ไวต่อเชื้อแบคทีเรีย เช่น ซัลโมเนลลา หรือพยาธิในอาหารดิบ'),
